import './sidepopup.scss';

const SidePopUpBar = () => {
    return(
        <div className='side-bars-container'>
            <div className='side-bar'>
                <div className='hidden'>
                    123456789
                </div>
                <div className='visible'>
                    <i className="fas fa-phone"></i>
                </div>
            </div>
        </div>
    )
}

export default SidePopUpBar;
